import React from 'react';
import { Link } from 'next/link';
import navbarAnimation from "../scripts/navbarAnimations";
import styles from '../css/Navigation.module.css'
import { ThemeContext } from "../App";


const Navigation = () => {

    navbarAnimation()

    return (
        <ThemeContext.Consumer>
            {theme =>
                <div className={styles.nav}>
                    <div id="nav-logo">
                        <Link href="/">
                            <img
                                className={styles.logo}
                                alt="logo"
                                src={theme.name === "light" ? '/images/logo/Logo.svg' : '/images/logo/LogoBlack.svg'}
                            />
                        </Link>
                    </div>
                    <div id="nav-item" className={styles.navItem}><Link className={styles.link} href="/contact">Contact</Link></div>
                    <div id="nav-item" className={styles.navItem}><Link className={styles.link} href="/about">About us</Link></div>
                    <div id="nav-item" className={styles.navItem}><Link className={styles.link} href="/trails">All trails</Link>
                    </div>
                </div>
            }
        </ThemeContext.Consumer>
    );
}

export default Navigation;
